import React from 'react';

interface Props {
    data?: {};
}

const Journals: React.FC<Props> = (props) => {
    const results: any = props.data;
    const filterResults: any = delete results['uid'];
    return (
        <>
            <div>{Object.keys(filterResults).map((key) => console.log(filterResults[key]))}</div>
        </>
    );
};

export default Journals;
